import React from 'react'
import SearchInput from './SearchInput';
import CadastrarContato from './CadastrarContato';

export default function Agenda() {
  return (
    <div>
        <h1>contatos:</h1>

        <SearchInput/> <button>+<CadastrarContato/></button>
        <ul>
          <li>Alejandro <button>edit</button></li>
          <li>Pedrito<button>edit</button></li>
          <li>Juanito <button>edit</button></li>
        </ul>
      
    </div>
  )
}
